function App() {



  return (
      <div className="App">

          <Router>

    <Switch>
          <Route exact path="/" component={ Home }></Route>
          <Route exact path="/Reservation" component={ Reservation }></Route>
          <Route exact path="/Administrator" component={ Administrator }></Route>
          <Route exact path="/Customer" component={ Customer }></Route>
          <Route exact path="/Table" component={ Table }></Route>
          <Route exact path="/Contact" component={ Contact }></Route>
          {/* <Route exact path="/About" component={ About }></Route> */}
          <Route exact path="/Menu" component={ MenuItem }></Route>
          <Route exact path="/Login" component={ Login }></Route>
          <Route exact path="/AfterLogin" component={ AfterLogin }></Route>
          <Route exact path="/Logout" component={ Logout }></Route>
    </Switch>

</Router>
</div>
);
}




export default App;
